	function createDistrict (coords, name, color, hoverColor,urls){
	   var myGeoObject = new ymaps.GeoObject({
			geometry: {
				type: "Polygon",
				coordinates: coords
			},
			properties: {
				hintContent: name
			}
		}, {
			fillColor: color,
			strokeWidth: 1,
			strokeColor: "#000"
		});
		 myGeoObject.events.add('mouseenter', function(e){
                    fillColor=myGeoObject.options.get('fillColor');
                    myGeoObject.options.set('fillColor', hoverColor);
                });

		myGeoObject.events.add('mouseleave', function(e){
                    myGeoObject.options.set('fillColor', fillColor);
                });
	myMap.geoObjects.add(myGeoObject);
	myGeoObject.events.add('click', function () {
        //document.location.href = urls;
    });
};

